    "my_news": "[{\"id\":1772144594426,\"title\":\"سل]{لرٍ]لأر\",\"text\":\"شس[رس]لأثسي\",\"mediaType\":\"youtube\",\"mediaUrl\":\"https://youtu.be/BAx0LI6NnNg?si=YhNdz02970509Mri\",\"image\":null,\"date\":\"٢٧‏/٢‏/٢٠٢٦ | الساعة: ١٢:٢٣ ص\"},{\"id\":1771460568729,\"text\":\"«صوت لا يُسمع».. الصم وضعاف السمع بين تحديات التعليم والعمل وغياب الدعم\\n\\n \\nآية فؤاد\\nصوتهم غير مسموع رغم أنهم يمثلون فئة كبيرة بالمجتمع، يواجهون تحديات عديدة تتمثل فى أمور حياتية عامة كالتعلم وتطبيق نسب التوظيف والتواصل إنهم الصم وضعاف السمع، ولسماع صوتهم من جديد لا بد من النظر لمشاكلهم، وتكاتف مؤسسات الدولة ومنظمات المجتمع المدنى لكسب أشخاص لديهم أحلام وقدرات ومواهب كثيرة.\\n\\n◄ ندرة في مترجمي لغة الإشارة بالمصالح الحكومية والمدارس\\n\\n◄ مطالبات بإتاحة كارت الخدمات المتكاملة لضعاف السمع\\n\\nيقدر عدد الأشخاص الصم فى مصر وفقاً للاتحاد العالمي للصم بـ 7.5 مليون شخص، فى حين أن وحدة الصم وهى منظمة معنية بتعليم ودمج الصم بالمجتمع تقدر عدد المصابين بالصم أو ضعف السمع بـ1.2 مليون شخص فى الفئة العمرية من 5 سنوات فما فوق، ورغم عدم وجود عدد محدد للصم وضعاف السمع فإن التقديرات عمومًا تشير لوجود أعداد كبيرة من الصم وضعاف السمع يواجهون عدة تحديات فى التعليم والعمل والاهتمام بلغة الإشارة.\\n\\n\\n صعوبات التعلم\\n\\nمحمد شعبان (20 عامًا) شاب من ذوى الإعاقة السمعية عانى منذ سنواته الأولى من مشكلات كثيرة كشخص من ذوى الإعاقة السمعية وتمثلت أهم مشاكله فى التعليم الذى افتقد للمناهج المناسبة أو لمترجمين لشرح ووصول المادة العلمية له ولزملائه، حتى حاول والداه إلحاقه بمدرسة داخلية خاصة متخصصة فى تعليم الصم وضعاف السمع ولكن مع الوقت ولأن أسرته من محافظة الفيوم والمدرسة الداخلى بالقاهرة وبجانب مصروفاتها الدراسية المرتفعة كان من الصعب الاستمرار بها واضطر لرجوعه مرة أخرى إلى أن حصل على شهادة الدبلوم.\\n\\nأما محمود صالح (26 عامًا) كان يحلم بدراسة علوم الحاسب ولكن ذوى الإعاقة السمعية لم يتح لهم من الجامعات سوى كلية التربية النوعية ليتخرج فيها، فلم يجد حل سوى اللجوء إلى دورات خاصة لإشباع شغفه فيما يخص التكنولوجيا.\",\"image\":null,\"videoUrl\":\"https://images.akhbarelyom.com/UP/20260131022350861.jpg\",\"date\":\"١٩ فبراير ٢٠٢٦، ٠١:١٢ م (مُعدل)\",\"originalUrl\":\"https://images.akhbarelyom.com/UP/20260131022350861.jpg\"},{\"id\":1771447972902,\"text\":\"📢 إعلان هام لطلاب برنامج إعداد أخصائي تكنولوجيا التعليم لذوي الاحتياجات الخاصة  \\nنرفق لكم اللائحة الخاصة ببرنامج إعداد أخصائي تكنولوجيا التعليم لذوي الاحتياجات الخاصة لمراجعتها والاطلاع على جميع التفاصيل المتعلقة بالمقررات، شروط الدراسة، والتقييم.  \\nhttps://sefac.mans.edu.eg/images/files/techlistcridet.pdf\\nيرجى الالتزام بما ورد في اللائحة لضمان سير الدراسة بشكل منظم وناجح.  \\nلأي استفسارات، الرجاء التواصل مع إدارة البرنامج عبر الصفحه او التوجه الي شئون الطلاب بالكليه.  \\n---------------------  \\n#برنامج_إعداد_أخصائي_تكنولوجيا_التعليم_ذوي_احتياجات_خاصة_نوعية_المنصورة\\n#تكنولوجيا_التعليم #ذوي_الاحتياجات_الخاصة #كلية_التربية_النوعية #جامعة_المنصورة #تعليم_دامج #إعداد_أخصائي #تعليم_حديث #فرص_عمل #دعم_ذوي_الإعاقة ♿️ #مصر2030 #عداله_وإندماج\\n#رؤية_مصر_2030\\n#Mansoura_University\",\"image\":null,\"videoUrl\":null,\"date\":\"١٩ فبراير ٢٠٢٦، ٠٣:٢٩ ص (معدل)\",\"originalUrl\":\"\"}]",
